import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import store from './store/index'


const render = () => {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
}

render();
store.subscribe(render);
